import {
  init_esm_shims
} from "./chunk-WWCIODDN.js";

// Modals/CustomEmbed/ce_send.ts
init_esm_shims();
var ce_send_default = {
  id: "ce_send",
  async execute(interaction) {
    const id = interaction.fields.getTextInputValue("channel");
    const channel = interaction.guild.channels.cache.get(id);
    if (!channel) return interaction.reply({ content: "Die angegebene ID f\xFChrt zu keinem Channel auf diesem Server", ephemeral: true });
    const embed = interaction.message.embeds[0];
    await interaction.reply({ content: `Das Embed wird in ${channel} geschickt!`, ephemeral: true });
    await channel.send({ embeds: [embed] });
  }
};
export {
  ce_send_default as default
};
